    super();
    this.state = {
      monsters : [
        {
          name 
        },
        {},
        {}
      ]
    };
  }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>{this.state.string}</p>
          <button
            onClick={() => this.setState({ string: "Hello Logged in User" })}
          >
            Change Text
          </button>
        </header>
      </div>
    );
  }
}

export default App;
